import ReactPlayer from 'react-player';
import "../Style/Video.css"

function VideoSender(props) {
    return (
        <div className="videoContainer sender">
            <ReactPlayer className="video" url={props.url} controls muted />
        </div>
    )
}

function VideoRecipient(props) {
    return (
        <div className="videoContainer recipient">
            <ReactPlayer className="video" url={props.url} controls muted />
        </div>
    )
}

export default function Video(props) {
    if (props.sender) {
        return <VideoSender url={props.url} />
    } else {
        return <VideoRecipient url={props.url} />
    }
}
